import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Link } from 'react-router-dom';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Image from 'react-bootstrap/Image';
// import NotFound from '../NotFound';
import './AppNav.css';
import { LinkContainer } from "react-router-bootstrap";

class AppNav extends Component {


  render() {
    const { authedUser } = this.props;
    return (
      <Navbar variant="dark" bg="dark" expand="sm">
        <Navbar.Brand to="/">Whould You Rather</Navbar.Brand>
        <Nav>
          <LinkContainer to="/">
            <Nav.Link active>Home</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/add">
            <Nav.Link>New Question</Nav.Link>
          </LinkContainer>
          <LinkContainer to="/leaderboard">
            <Nav.Link >Leaderboard</Nav.Link>
          </LinkContainer>
          {/* <Nav.Link to="/" active>Home</Nav.Link>
          <Nav.Link to="/add" exact >New Question</Nav.Link>
          <Nav.Link to="/leaderboard">Leaderboard</Nav.Link> */}
        </Nav>
        <Navbar.Collapse className="justify-content-end">
          <Navbar.Text>
            {"Hello, " + authedUser.name}
          </Navbar.Text>
          <Image className="avatar" src={"../../assets/images/" + authedUser.avatarURL} alt="user avatar" />
          <Nav>
            <Nav.Link to="/login">Logout</Nav.Link>
          </Nav>
        </Navbar.Collapse >
      </Navbar >
    )
  }
}

const mapStateToProps = ({ authedUser }) => {
  return {
    authedUser
  }
}

export default connect(mapStateToProps)(AppNav);
